script: |
  super -f text -I q12585.spq | sort > q12585.out

inputs:
  - name: q12585.spq
    data: |
      SELECT DISTINCT + + ( - + col2 ) - - ( col0 ) FROM tab0 (FORMAT parquet) AS cor0 WHERE + 5 NOT BETWEEN CAST ( NULL AS INTEGER ) * + - 68 * 54 + + 1 AND + - ( + col2 ) + + - col1 + - + col2 * + + col0;
  - name: tab0

outputs:
  - name: q12585.out
    data: |
      -2
      -32
      77
